import React from 'react';
import logo from './logo.svg';
import './App.css';

function Display(props){
  return (
    <div className="App">
      <p>{props.value}</p>
    </div>
  );
}
function Button(props){
  return (
   <button>{props.text} </button>
  );
}

function App() {
  return (
    <div className="App">
      <Display value='1'/>
      <Button text="5"/>
    </div>
  );
}

export default App;
